  const getLastWeekDateRange = () => {
    const now = new Date();
    const today = new Date(now);

    // Get the day of week (0 = Sunday, 1 = Monday, etc.)
    const dayOfWeek = today.getDay();

    // Calculate last Monday (start of last week)
    const lastMonday = new Date(today);
    lastMonday.setDate(today.getDate() - dayOfWeek - 6);

    // Calculate last Sunday (end of last week)
    const lastSunday = new Date(today);
    lastSunday.setDate(today.getDate() - dayOfWeek);

    // Format dates as "MMM DD"
    const formatDate = (date: Date) => {
      return date.toLocaleDateString('en-US', {
        month: 'short',
        day: 'numeric'
      });
    };

    return `${formatDate(lastMonday)} - ${formatDate(lastSunday)}`;
  };

  // Function to get the title based on selected date filter
